import React, { useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import gsap from 'gsap';
import '../styles/Index.css';

const Index = () => {
  const orbitRef = useRef(null);

  useEffect(() => {
    initializeMemberOrbit();
  }, []);

  const initializeMemberOrbit = () => {
    const members = document.querySelectorAll(".member");
    const total = members.length;
    const radius = 60;

    members.forEach((m, i) => {
      const angle = (i / total) * Math.PI * 2;
      const x = Math.cos(angle) * radius;
      const y = Math.sin(angle) * radius;
      gsap.set(m, { x, y });
    });

    if (orbitRef.current) {
      gsap.to(orbitRef.current, {
        rotation: 45,
        duration: 15,
        repeat: -1,
        ease: "none",
        transformOrigin: "50% 50%"
      });
    }
  };

  const videos = [
    { src: 'videos/video1.mp4', title: 'People of this country', description: 'Hi I am Rahul Kumar Singh, I am studying in NIT Calicut.' },
    { src: 'videos/video2.mp4', title: 'Truth and Reality', description: 'Nobody cares about you until you care about yourself.' },
    { src: 'videos/video3.mp4', title: 'Everybody watches you', description: 'I try to watch myself but still do what I want.' }
  ];

  const members = [
    { src: 'members/ayush_aditya.jpeg', name: 'Ayush Aditya', position: 'Founder' },
    { src: 'members/member1.jpeg', name: 'Kamlesh', position: 'Secretary' },
    { src: 'members/member2.jpeg', name: 'Piyush', position: 'Malik' },
    { src: 'members/member3.jpeg', name: 'Rahul Kumar', position: 'Event Organizer' },
    { src: 'members/member5.jpeg', name: 'Ravikant', position: 'Event Organizer' },
    { src: 'members/member6.jpeg', name: 'Riya', position: 'Event Organizer' },
    { src: 'members/member12.jpeg', name: 'Suryansh', position: 'Event Organizer' },
    { src: 'members/member15.jpeg', name: 'Ankit Pal', position: 'Event Organizer' },
    { src: 'members/member17.jpeg', name: 'Khusi Tiwari', position: 'Event Organizer' }
  ];

  return (
    <div className="index-page">
      <header className="flex flex-col md:flex-row justify-between items-center mb-10 pb-4 border-b-2 border-amber-900/20 px-2">
        <div className="content-text px-2">
          <img src="https://nitc.ac.in/xc-assets/logo/nitc_logo_icon.svg" alt="NITC Logo" className="w-18 h-14" />
          <h3 className="text-2xl md:text-1xl">
            NATIONAL INSTITUTE OF TECHNOLOGY CALICUT
          </h3>
        </div>

        <div className="flex items-center justify-center gap-4 bg-black-400 text-white font-semibold text-2lg md:text-xl px-8 py-4">
          <nav className="flex flex-wrap gap-x-4 gap-y-2 text-lg parchment-text content-text">
            <Link to="/home">Home</Link>
            <Link to="/science">Science</Link>
            <Link to="/spirituality">Spirituality</Link>
            <Link to="/gallery">Gallery</Link>
            <Link to="/events">Events</Link>
            <Link to="/overview">Overview</Link>
          </nav>
        </div>
      </header>

      <section className="relative h-[300px] overflow-hidden flex items-center justify-center bg-black">
        <div id="video-slider" className="relative w-full h-full flex items-center justify-center px-8">
          {videos.map((video, index) => (
            <div key={index} className={`video-slide-wrapper ${index === 0 ? 'active' : ''}`}>
              <video src={video.src} className="video-slide" autoPlay loop muted />
              <div className="video-info">
                <h3>{video.title}</h3>
                <p>{video.description}</p>
              </div>
            </div>
          ))}
        </div>
        <button id="prevBtn" className="absolute left-4 top-1/2 transform -translate-y-1/2 z-20 bg-black/50 hover:bg-black/70 p-3 rounded-full text-white">
          &#10094;
        </button>
        <button id="nextBtn" className="absolute right-4 top-1/2 transform -translate-y-1/2 z-20 bg-black/50 hover:bg-black/70 p-3 rounded-full text-white">
          &#10095;
        </button>
      </section>

      <section id="revolution-members" className="relative w-full min-h-[600px] md:h-[400px] from-purple-950 to-purple-950 flex flex-col items-center justify-center overflow-hidden z-10">
        <h2 className="text-4xl md:text-5xl font-extrabold text-amber-300 drop-shadow-lg mb-10 z-20">
          Our Team
        </h2>

        <div id="orbit" className="relative w-[300px] h-[300px] md:w-[300px] md:h-[300px] rounded-full flex items-center justify-center z-10">
          <div className="absolute inset-0" id="orbit-container" ref={orbitRef}>
            {members.map((member, index) => (
              <img
                key={index}
                src={member.src}
                className="member absolute w-20 h-20 rounded-full object-cover border-4 border-amber-700 shadow-xl"
                data-name={member.name}
                data-position={member.position}
                alt={member.name}
              />
            ))}
          </div>

          <div id="center-photo" className="absolute w-28 h-28 md:w-40 md:h-40 rounded-full border-4 border-amber-500 shadow-2xl overflow-hidden z-20">
            <img src="members/ayush_aditya.jpeg" id="center-img" className="w-full h-full object-cover animate-pulse-glow" alt="Center member" />
            <div className="absolute inset-0 flex flex-col items-center justify-center text-center bg-gradient-to-b from-black/20 via-black/10 to-transparent rounded-full pointer-events-none animate-fade-in">
              <h6 id="member-name" className="text-2xl font-extrabold text-amber-300 drop-shadow-[0_0_10px_rgba(255,200,0,0.8)] tracking-wide animate-glow">
                Ayush Aditya
              </h6>
              <p id="member-position" className="text-lg text-white/90 italic mt-1 drop-shadow-[0_0_6px_rgba(255,255,255,0.6)]">
                Founder
              </p>
            </div>
          </div>
        </div>

        <div className="flex gap-10 mb-9 z-20">
          <button id="prevBtn" className="px-6 py-3 text-white rounded-full hover:bg-amber-600 transition">
            ⟵ Prev
          </button>
          <button id="nextBtn" className="px-6 py-3 text-white rounded-full hover:bg-amber-600 transition">
            Next ⟶
          </button>
        </div>
      </section>
    </div>
  );
};

export default Index;
